import { Checkbox, Button, TableRow, TableCell } from '@material-ui/core';
import React from 'react';
import { MoreHoriz as MoreIcon } from '@material-ui/icons';
import RowStyle from './body.style';

function Row(props) {
  const styles = RowStyle();
  return (
        <TableRow key={props.row._id} className={props.index % 2 === 0 ? styles.evenRow : styles.oddRow}>
            <TableCell>
                <Checkbox
                    inputProps={{ 'aria-label': 'select all desserts' }}
                />
            </TableCell>
            <TableCell className={styles.cell} component="th" scope="row">{props.row.username}</TableCell>
            <TableCell className={styles.cell}>{props.row.email}</TableCell>
            <TableCell className={styles.cell}>{props.row.createdAt}</TableCell>
            <TableCell className={styles.cell}>{props.row.updatedAt}</TableCell>
            <TableCell className={styles.cell}>{props.row.rules}</TableCell>
            <TableCell className={props.row.status ? styles.green : styles.red} >{props.row.status ? "Ativo" : "Inativo"}</TableCell>
            <TableCell >
                <Button
                    aria-label='more'
                    className={styles.button}
                    onClick={() => { }}>
                    <MoreIcon className={styles.gray} />
                </Button>
            </TableCell>
        </TableRow>
    );
}

export default Row;
